import React, { useEffect } from 'react';
import { motion } from 'framer-motion';
import { useNavigate } from 'react-router-dom';
import AOS from 'aos';
import 'aos/dist/aos.css';

const Hero = () => {
  const navigate = useNavigate();

  useEffect(() => {
    AOS.init({
      duration: 1000,
      once: true,
    });
  }, []);

  // Animation variants cho hoa mai rơi
  const flowerVariants = {
    initial: { y: -100, opacity: 0, rotate: 0 },
    animate: { 
      y: 700,
      opacity: [0, 1, 1, 0],
      rotate: 360,
      transition: { 
        duration: 5,
        repeat: Infinity,
        ease: "linear"
      }
    }
  };

  // Animation variants cho pháo hoa
  const fireworkVariants = {
    initial: { scale: 0, opacity: 0 },
    animate: {
      scale: [0, 1.2, 0],
      opacity: [0, 1, 0],
      transition: {
        duration: 1.5,
        repeat: Infinity,
        repeatDelay: 3
      }
    }
  };

  return (
    <div className="relative min-h-screen flex items-center overflow-hidden">
      {/* Background với gradient và overlay */}
      <div className="absolute inset-0 bg-gradient-to-r from-red-600 to-yellow-500 opacity-10"></div>

      {/* Hoa mai rơi */}
      {[...Array(10)].map((_, i) => (
        <motion.div
          key={i}
          className="absolute"
          style={{
            left: `${Math.random() * 100}%`,
            top: -20
          }}
          variants={flowerVariants}
          initial="initial"
          animate="animate"
          custom={i}
        >
          <span className="text-2xl">🌸</span>
        </motion.div>
      ))}

      {/* Pháo hoa */}
      {[...Array(5)].map((_, i) => (
        <motion.div
          key={i}
          className="absolute"
          style={{
            left: `${20 + Math.random() * 60}%`,
            top: `${20 + Math.random() * 40}%`
          }}
          variants={fireworkVariants}
          initial="initial"
          animate="animate"
          custom={i}
        >
          <span className="text-4xl">✨</span>
        </motion.div>
      ))}

      {/* Main content */}
      <div className="max-w-7xl mx-auto px-4 sm:px-6 lg:px-8 relative z-10">
        <div className="text-center">
          <motion.div
            initial={{ opacity: 0, y: 20 }}
            animate={{ opacity: 1, y: 0 }}
            transition={{ duration: 0.5 }}
            className="relative"
          >
            {/* Trang trí Tết */}
            <div className="absolute -top-10 left-1/2 transform -translate-x-1/2">
              <span className="text-4xl">🏮</span>
            </div>

            <h1 className="text-4xl tracking-tight font-extrabold text-gray-900 sm:text-5xl md:text-6xl">
              <span className="block">Chúc Mừng Năm Mới</span>
              <span className="block text-blue-600">Phuc An Solutions</span>
            </h1>

            <p className="mt-3 max-w-md mx-auto text-base text-gray-500 sm:text-lg md:mt-5 md:text-xl md:max-w-3xl">
              Mang đến giải pháp công nghệ toàn diện cho doanh nghiệp của bạn
            </p>

            <div className="mt-5 max-w-md mx-auto sm:flex sm:justify-center md:mt-8">
              <div className="rounded-md shadow">
                <button
                  onClick={() => navigate('/contact')}
                  className="w-full flex items-center justify-center px-8 py-3 border border-transparent text-base font-medium rounded-md text-white bg-blue-600 hover:bg-blue-700 md:py-4 md:text-lg md:px-10"
                >
                  Liên Hệ Ngay
                </button>
              </div>
              <div className="mt-3 rounded-md shadow sm:mt-0 sm:ml-3">
                <button
                  onClick={() => navigate('/services')}
                  className="w-full flex items-center justify-center px-8 py-3 border border-transparent text-base font-medium rounded-md text-blue-600 bg-white hover:bg-gray-50 md:py-4 md:text-lg md:px-10"
                >
                  Tìm Hiểu Thêm
                </button>
              </div>
            </div>
          </motion.div>
        </div>
      </div>

      {/* Trang trí góc */}
      <div className="absolute bottom-0 left-0 text-6xl">🎋</div>
      <div className="absolute bottom-0 right-0 text-6xl">🎋</div>
      <div className="absolute top-0 left-0 text-4xl">🏮</div>
      <div className="absolute top-0 right-0 text-4xl">🏮</div>
    </div>
  );
};

export default Hero;
